                    inventory_adjustment_details iad
                WHERE
                    iad.BranchAutoId = 1
                AND iad.product_id =12
                GROUP BY iad.product_id 
                ) AS inv_adj_table ON inv_adj_table.product_id= p.product_id
                
                WHERE
                    p.product_id = 12
