JOIN `so_po_productes` ON `so_po_productes`.`so_po_id`=`so_po_info`.`id`
WHERE `so_po_info`.`is_active` = 'Y'
AND `so_po_info`.`form_id` = '7'
GROUP BY `so_po_info`.`id`
ORDER BY `so_po_info`.`id` DESC, `so_po_info`.`so_po_date` DESC
 LIMIT 10
